import React, { useEffect } from 'react';
import Location from '../components/home-page/Location';
import Search from '../components/home-page/Search';
import Categories from '../components/home-page/Categories';
import EscortContent from '../components/home-page/EscortContent';
import { connect } from 'react-redux';
import { getCategories, getAllPosts, getLocationsInfo } from '../redux/actions/actions';

function Home({ categories, getCategories, getAllPosts, posts, getLocationsInfo, states }) {

	useEffect(() => {
		getCategories();
		getAllPosts();
		getLocationsInfo();
	}, []);

	return (
		<div>
			<Location states={states} />
			<Search />
			<Categories categories={categories} />
			<EscortContent posts={posts} />
		</div>
	);
}


const mapStateToProps = state => {
	return {
		...state,
		categories: state.app.categories,
		posts: state.app.posts,
		states: state.app.states
	};
};

const mapDispatchToPops = {
	getCategories, getAllPosts, getLocationsInfo
}

export default connect(mapStateToProps, mapDispatchToPops)(Home);
